import {Container } from 'react-bootstrap';
import { useLocation } from 'react-router-dom';
import { CardComponent2 } from '../Components/CardComponent2';
import { CardComponent } from '../Components/CardComponent';

function FourthPage(){
        console.log("Fourth Page");
        const location = useLocation();
        const record  = location.state.data;
        console.log(data);

    return (<div>
        <Container fluid>
            <CardComponent2 data = {data}/>
            <CardComponent ID = {record.id} title = {record.title} firstName = {record.firstName} lastName = {record.lastName} picture = {record.picture} email = {record.email} />
        </Container>
    </div>);
}

export default FourthPage;
